(function($){

    $(document).ready(function(){

        $(".top_slider").each(function(){
            let obj =  $(this);
            obj.slick({
                dots: true,
                arrows: true,
            });
            obj.parent().find(".left.slick-control").on("click",function(){                
                obj.slick('slickNext');
            });
            obj.parent().find(".right.slick-control").on("click",function(){
                
                obj.slick('slickPrev');
            });
        });

    });
})(jQuery);





(function($){
    $(document).ready(function(){

      /*
      $(".pj_select").select2({
        width:'80%'
      });
      */
     $(".pj_select").selectpicker();


        console.log('init3');

        var acc = document.getElementsByClassName("accordion");
        var i;
        
        
        for (i = 0; i < acc.length; i++) {


          if($(acc[i]).hasClass('active')){
            $(acc[i]).find('span.fa').addClass('fa-minus').removeClass('fa-plus');
            var panel = acc[i].nextElementSibling;
            $(panel).css('max-height',panel.scrollHeight + "px");
          }


          $(acc[i]).on("click",function(){
            var panel = this.nextElementSibling;

            $(this).siblings('.accordion').removeClass('active');
            $(this).next().siblings('.panel').css('max-height','0px');
            $(this).siblings('.accordion').find('span.fa').removeClass('fa-minus').addClass('fa-plus');

            if(!$(this).hasClass('active')){     
             $(this).addClass('active');       
             $(this).find('span.fa').addClass('fa-minus').removeClass('fa-plus');
             
             $(panel).css('max-height',panel.scrollHeight + "px");
            
            }else{
              $(this).removeClass('active');            
              $(this).next('.panel').css('max-height','0px');
              $(this).find('.fa').removeClass('fa-minus').addClass('fa-plus');
            }

           }); 

           
        }     
        
        $("#global_menu .search form input").on('focus',function(){
            $(this).addClass('active');
        });
        
        $("#header .menu_trigger").on("click",function(e){
          e.preventDefault();
          
          $("#global_menu").toggleClass("open");
        });

        $("#exit").on("click",function(e){                   
          $("#global_menu").toggleClass("open");
          $("#global_menu .search form input").removeClass('active');
        });

        $("#global_menu .mask_back").on("click",function(){
          $("#global_menu").removeClass("open");
          $("#global_menu .search form input").removeClass('active');
        });


        $("#main_text.hidemore .toggle_class").on("click",function(e){
          e.preventDefault();
          $("#main_text").removeClass("hidemore");
        });  


        
        setTimeout(function(){
          $("#loading_mask").addClass('hideme');
          setTimeout(function(){
            $("#loading_mask").addClass('end');
          },300);
        },800);


    });
})(jQuery);